/**
 * Different types of NotificationListItemImportance.
 *
 * @public
 */
enum NotificationListItemImportance {
	/**
	 * @public
	 */
	Standard = "Standard",

	/**
	 * @public
	 */
	Important = "Important",
}

export default NotificationListItemImportance;
